function anew_ex_extend( term, avg, std, fq )

  //  Extend the ANEW dictionary with the given term
  //
  //  term:  Term to add
  //  avg:   [ valence, arousal ] averages
  //  std:   [ valence, arousal ] standard deviations
  //  fq:    Term evaluation frequency
{
  var  stem;				// Stemmed term


  term = term.toLowerCase();
  stem = stemmer( term );

  //  Warning if we're replacing terms rather than adding them

  if ( anew_ex_term.hasOwnProperty( term ) ) {
    console.log( "anew_ex_extend(), replacing term " + term );
  }
  if ( anew_ex_stem.hasOwnProperty( stem ) ) {
    console.log( "anew_ex_extend(), replacing stem " + stem );
  }

  anew_ex_term[ term ] = { dict: "anew-ex",
    word: term, stem: stem, avg: avg, std: std, fq: fq };
  anew_ex_stem[ stem ] = { dict: "anew-ex-stem",
    word: term, stem: stem, avg: avg, std: std, fq: fq };
}					// End routine anew_ex_extend


function anew_ex_find_stem( s )

  //  Return the stem's in the ANEW dictionary, or -1 if no such stem
  //
  //  s:  Stem to search
{
  if ( s.length == 0 ) {		// Empty term?
    return -1;
  }

  if ( anew_ex_stem.hasOwnProperty( s ) ) {
    return anew_ex_stem[ s ];
  }

  return -1;
}					// End routine anew_ex_find_stem


function anew_ex_find_word( w )

  //  Return the word's in the ANEW dictionary, or -1 if no such word
  //
  //  w:  Word to search
{
  if ( w.length == 0 ) {		// Empty term?
    return -1;
  }

  if ( anew_ex_term.hasOwnProperty( w ) ) {
    return anew_ex_term[ w ];
  }

  return -1;
}					// End routine anew_ex_find_word
